import '../styles/App.css';
import React from "react";
import { Switch , Route , Router} from "react-router-dom";

import Register from "../components/Register"; 

function App() {



  return (
  <>
    <Router>
      <Switch>

          <Route path="/login" exact component={Register} />

      </Switch>
    </Router>


  </>
  );
}
export default App;
